import React from "react";
import { createTheme, ThemeProvider } from '@mui/material/styles';

import "../../src/index.css";
import LeftSidebar from "../shared/LeftSideBar";
import Bottombar from "../shared/BottomBar";
import RightSidebar from "../shared/RightSideBar";
import Topbar from "../shared/TopBar";

const darkTheme = createTheme({
  palette: {
    mode: 'dark', // Set the mode to 'dark'
    primary: {
      main: '#1F1F22', // Your desired primary color for dark mode
    },
    secondary: {
      main: '#ffc107', // Your desired secondary color for dark mode
    },
    background: {
      default: '#000000', // Dark background color
      paper: '#424242', // Background color for components on top of dark background
    },    text: {
      primary: '#fff', // Light color for text
    },
  },
});

function Home() {
  return (
    <section>
        <body>
          <Topbar />

          <main className='flex flex-row'>
            <LeftSidebar />
            <section className='main-container'>
              <div className='w-full max-w-4xl'>{''}</div>
            </section>
            <RightSidebar />
          </main>

          <Bottombar />
        </body>
        </section>
  );
}
export default Home;
